class SegmentTree:
    def __init__(self,data:List[int]) -> None:
        self.data=data 
        self.tree_data=[ [] for i in range(len(self.data)*4) ]
        self._build(0,len(self.data)-1,0)


    def _left(self,index):
        return 2*index+1
    def _right(self,index):
        return 2*index+2
    def merge_tree(self,tree_left_index,tree_right_index):
        ans=[]
        left_nodes=self.tree_data[tree_left_index]
        
        right_nodes=self.tree_data[tree_right_index]
        l=r=0
        while l<len(left_nodes) and r < len(right_nodes):
            if left_nodes[l]<right_nodes[r]:
                ans.append(
                    left_nodes[l]
                )
                l+=1
            else:
                ans.append(right_nodes[r])
                r+=1
        while l<len(left_nodes):
            ans.append(
                    left_nodes[l]
                )
            l+=1
        while r<len(right_nodes):
            ans.append(right_nodes[r])
            r+=1
        return ans 


    def _build(self,left_index,right_index,tree_index):
        if left_index==right_index:
            self.tree_data[tree_index].append(self.data[left_index])
            return 
        mid=(left_index+right_index)//2
        tree_left_index= self._left(tree_index)
        tree_right_index= self._right(tree_index)
        self._build(left_index,mid, tree_left_index)
        self._build(mid+1,right_index,tree_right_index)
        self.tree_data[tree_index]=self.merge_tree(tree_left_index,tree_right_index)
 
    def udpate(self):
        pass 
    def _query_lower(self,tree_index,tree_left,tree_right ,left,right,val):

        if tree_left>right or tree_right<left:
            return 0 
        if tree_left>=left and tree_right<=right:
            return  lower_bound(self.tree_data[tree_index],val)
        mid=(tree_left+tree_right)//2 
        return self._query_lower(self._left(tree_index) , tree_left, mid , left , right ,val ) + self._query_lower(self._right(tree_index), mid+1 , tree_right , left , right , val  )

    def _query_higher(self,tree_index,tree_left,tree_right ,left,right,val):

        if tree_left>right or tree_right<left:
            return 0 
        if tree_left>=left and tree_right<=right:
            return  len(self.tree_data[tree_index])-higher_bound(self.tree_data[tree_index],val)
        mid=(tree_left+tree_right)//2 
        return self._query_higher(self._left(tree_index) , tree_left, mid , left , right ,val ) + self._query_higher(self._right(tree_index), mid+1 , tree_right , left , right , val  )

        pass 
    def query_lower(self,left,right,val):
        return self._query_lower(0,0,len(self.data)-1,left,right,val)
    
    def query_higher(self,left,right,val):
       return  self._query_higher(0,0,len(self.data)-1,left,right,val) 

class Solution:
    def goodTriplets_2(self, nums1: List[int], nums2: List[int]) -> int:
        # 剪枝算法,加递归的算法。
        def per_n3(nums1,curent_index,ans):
            # stop的一些条件
            if curent_index>len(nums1)-(3-len(ans)):
                return 0
            if len(ans)==2:

                num=nums1[curent_index]
                nums2_index=mapping_index_nums2[num]
                if nums2_index>ans[-1]:
                    return 1 + per_n3(nums1,curent_index+1, ans)
                return per_n3(nums1,curent_index+1, ans)

            if len(ans)==1:
                num=nums1[curent_index]
                nums2_index=mapping_index_nums2[num]
                if nums2_index>ans[-1]:
                    return per_n3(nums1,curent_index+1, ans+[nums2_index])+per_n3(nums1,curent_index+1, ans)
                return per_n3(nums1,curent_index+1, ans)
            
            num=nums1[curent_index]
            nums2_index=mapping_index_nums2[num]
            if nums2_index>NUM_LEN-3:
                return per_n3(nums1,curent_index+1,ans)
            mapping_index_nums2={}
            for index,num in enumerate(nums2):
                mapping_index_nums2[num]=index 
            NUM_LEN=len(nums1)
            return per_n3(nums1,curent_index+1,ans)+per_n3(nums1,curent_index+1,ans+[nums2_index])

          

        # 剪枝算法,当nums1 的 n1 n2  对应的 不满足 nums2 p1 < p2  时，就不用再看了。 p1对应的隐藏条件 p1位置, p1<=n-2
        # 剩下就是写排列算法，从n中选择三个数的算法。 
        return per_n3(nums1,0,[])
    def goodTriplets(self, nums1: List[int], nums2: List[int]) -> int:
        # x，y，z 先找到  
        NUM_LEN=len(nums1)
        mapping_index_nums2={}
        for index,num in enumerate(nums2):
            mapping_index_nums2[num]=index 
        nums1_mapping_num2_index=[]# 
        for num in nums1:
            nums1_mapping_num2_index.append(mapping_index_nums2[num])# nums1 在nums2的索引
        seg_tree_obj=SegmentTree(nums1_mapping_num2_index)
        ans=0
        for index in range(1,len(nums1)-1):
            nums2_index=nums1_mapping_num2_index[index]
            # smaller=sum([ 1 for smaller_index in nums1_mapping_num2_index[:index] if smaller_index < nums2_index ])
            # larger= sum([ 1 for larger_index in nums1_mapping_num2_index[index+1:] if larger_index> nums2_index ]) 
            smaller = seg_tree_obj.query_lower(0,index-1 ,nums2_index)
            larger = seg_tree_obj.query_higher(index+1,NUM_LEN-1,nums2_index)
            ans+=smaller*larger

        return ans 

        
        



